import React, { useEffect, useState } from 'react';
import axios from 'axios';

function MarketDataCards() {
  const [marketData, setMarketData] = useState([]);
  const [activeTab, setActiveTab] = useState('Top Gainers');
  const tabs = ['Top Gainers', 'Top Losers', 'Most Active'];

  useEffect(() => {
    const fetchMarketData = async () => {
      try {
        const symbols = ['AAPL', 'GOOGL', 'TSLA', 'MSFT', 'AMZN', 'IBM', 'NVDA', 'NFLX', 'BABA', 'INTC'];
        const apiKey = 'd0fn8qhr01qr6dbt4n3gd0fn8qhr01qr6dbt4n40';
        const requests = symbols.map(symbol =>
          axios.get(`https://finnhub.io/api/v1/quote`, {
            params: { symbol, token: apiKey }
          })
          .then(response => ({
            stockSymbol: symbol,
            price: response.data.c,
            change: response.data.d,
            percentChange: response.data.dp,
            volume: response.data.v // Assuming volume is available here
          }))
        );
        const results = await Promise.all(requests);
        setMarketData(results);
      } catch (error) {
        console.error('Error fetching market data from Finnhub:', error);
      }
    };

    fetchMarketData();
  }, []);

  const filterData = () => {
    switch (activeTab) {
      case 'Top Gainers':
        return [...marketData].sort((a, b) => b.percentChange - a.percentChange);
      case 'Top Losers':
        return [...marketData].sort((a, b) => a.percentChange - b.percentChange);
      case 'Most Active':
        return [...marketData].sort((a, b) => (b.volume || 0) - (a.volume || 0));
      default:
        return marketData;
    }
  };

  const filteredData = filterData();

  return (
    <div className="bg-gradient-to-br from-[#1e293b] via-[#22304a] to-[#0f172a] p-8 rounded-3xl shadow-2xl max-w-3xl mx-auto mt-10 border border-[#334155]">
      <h2 className="text-3xl font-extrabold mb-6 text-center text-[#00BFFF] tracking-tight drop-shadow-lg">Market Highlights</h2>
      {/* Tabs */}
      <div className="flex justify-center space-x-4 mb-8">
        {tabs.map(tab => (
          <button
            key={tab}
            onClick={() => setActiveTab(tab)}
            className={`px-6 py-2 rounded-full font-semibold transition-all duration-200 shadow-sm
              ${activeTab === tab
                ? 'bg-[#00BFFF] text-white scale-105'
                : 'bg-[#334155] text-gray-300 hover:bg-[#475569] hover:text-white'
              }`}
          >
            {tab}
          </button>
        ))}
      </div>
      {/* Table */}
      <div className="overflow-x-auto rounded-2xl shadow-inner">
        <table className="w-full text-left bg-[#1e253b]/80 rounded-2xl">
          <thead>
            <tr className="border-b border-[#334155]">
              <th className="py-3 px-4 font-bold text-[#94a3b8] text-lg">Stock</th>
              <th className="py-3 px-4 font-bold text-[#94a3b8] text-lg">Price</th>
              <th className="py-3 px-4 font-bold text-[#94a3b8] text-lg">Change</th>
              <th className="py-3 px-4 font-bold text-[#94a3b8] text-lg">Chg %</th>
            </tr>
          </thead>
          <tbody>
            {filteredData.map(item => (
              <tr
                key={item.stockSymbol}
                className="border-b border-[#334155] hover:bg-[#22304a]/60 transition-colors duration-150"
              >
                <td className="py-3 px-4 font-bold text-[#e0e7ef]">{item.stockSymbol}</td>
                <td className="py-3 px-4 text-[#f1f5f9] font-medium">
                  {item.price !== null ? `$${item.price.toFixed(2)}` : 'N/A'}
                </td>
                <td className={`py-3 px-4 font-semibold flex items-center gap-1 ${
                  item.change >= 0 ? 'text-green-400' : 'text-red-400'
                }`}>
                  {item.change !== null ? (
                    <>
                      {item.change >= 0 ? (
                        <span className="inline-block align-middle">▲</span>
                      ) : (
                        <span className="inline-block align-middle">▼</span>
                      )}
                      {item.change.toFixed(2)}
                    </>
                  ) : 'N/A'}
                </td>
                <td className={`py-3 px-4 font-semibold ${
                  item.percentChange >= 0 ? 'text-green-400' : 'text-red-400'
                }`}>
                  {item.percentChange !== null ? `${item.percentChange.toFixed(2)}%` : 'N/A'}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default MarketDataCards;
